#ifndef MAPBOX_GL_JS
    v_pos_a = u_patternscale_a * a_pos + u_offset_a;
    v_pos_b = u_patternscale_b * a_pos + u_offset_b;
#else
    vec2 scaled_size_a = u_scale_a * u_pattern_size_a;
    vec2 scaled_size_b = u_scale_b * u_pattern_size_b;

    // the correct offset needs to be calculated.
    // 
    // The offset depends on how many pixels are between the world origin and
    // the edge of the tile:
    // vec2 offset = mod(pixel_coord, size)
    //
    // At high zoom levels there are a ton of pixels between the world origin
    // and the edge of the tile. The glsl spec only guarantees 16 bits of
    // precision for highp floats. We need more than that.
    //
    // The pixel_coord is passed in as two 16 bit values:
    // pixel_coord_upper = floor(pixel_coord / 2^16)
    // pixel_coord_lower = mod(pixel_coord, 2^16)
    //
    // The offset is calculated in a series of steps that should preserve this precision:
    vec2 offset_a = mod(mod(mod(u_pixel_coord_upper, scaled_size_a) * 256.0, scaled_size_a) * 256.0 + u_pixel_coord_lower, scaled_size_a);
    vec2 offset_b = mod(mod(mod(u_pixel_coord_upper, scaled_size_b) * 256.0, scaled_size_b) * 256.0 + u_pixel_coord_lower, scaled_size_b);

    v_pos_a = (u_tile_units_to_pixels * a_pos + offset_a) / scaled_size_a;
    v_pos_b = (u_tile_units_to_pixels * a_pos + offset_b) / scaled_size_b;
#endif
}
"

"#ifdef GL_ES
precision mediump float;
#else
#define lowp
#define mediump
#define highp
#endif

#ifndef MAPBOX_GL_JS
uniform sampler2D u_image;
uniform float u_opacity;
#endif

#ifndef MAPBOX_GL_JS
varying vec2 v_pos;
#else
uniform float u_opacity0;
uniform float u_opacity1;
uniform sampler2D u_image0;
uniform sampler2D u_image1;
varying vec2 v_pos0;
varying vec2 v_pos1;
#endif

uniform float u_brightness_low;
uniform float u_brightness_high;

uniform float u_saturation_factor;
uniform float u_contrast_factor;
uniform vec3 u_spin_weights;

void main() {

#ifndef MAPBOX_GL_JS
    vec4 color = texture2D(u_image, v_pos) * u_opacity;
#else
    // read and cross-fade colors from the main and parent tiles
    vec4 color0 = texture2D(u_image0, v_pos0);
    vec4 color1 = texture2D(u_image1, v_pos1);
    vec4 color = color0 * u_opacity0 + color1 * u_opacity1;
#endif
    vec3 rgb = color.rgb;

    // spin
    rgb = vec3(
        dot(rgb, u_spin_weights.xyz),
        dot(rgb, u_spin_weights.zxy),
        dot(rgb, u_spin_weights.yzx));

    // saturation
    float average = (color.r + color.g + color.b) / 3.0;
    rgb += (average - rgb) * u_saturation_factor;

    // contrast
    rgb = (rgb - 0.5) * u_contrast_factor + 0.5;

    // brightness
    vec3 u_high_vec = vec3(u_brightness_low, u_brightness_low, u_brightness_low);
    vec3 u_low_vec = vec3(u_brightness_high, u_brightness_high, u_brightness_high);

    gl_FragColor = vec4(mix(u_high_vec, u_low_vec, rgb), color.a);

#ifdef OVERDRAW_INSPECTOR
    gl_FragColor = vec4(1.0);
#endif
}
"

"#ifdef GL_ES
precision highp float;
#else
#define lowp
#define mediump
#define highp
#endif

uniform mat4 u_matrix;
#ifndef MAPBOX_GL_JS
uniform float u_buffer;
#else
uniform vec2 u_tl_parent;
uniform float u_scale_parent;
uniform float u_buffer_scale;
#endif

attribute vec2 a_pos;
#ifdef MAPBOX_GL_JS
attribute vec2 a_texture_pos;
#endif

#ifndef MAPBOX_GL_JS
varying vec2 v_pos;

#else
varying vec2 v_pos0;
varying vec2 v_pos1;
#endif

void main() {
    gl_Position = u_matrix * vec4(a_pos, 0, 1);
#ifndef MAPBOX_GL_JS
    float dimension = (8192.0 + 2.0 * u_buffer);
    v_pos = (a_pos / dimension) + (u_buffer / dimension);
#else
    v_pos0 = (((a_texture_pos / 32767.0) - 0.5) / u_buffer_scale ) + 0.5;
    v_pos1 = (v_pos0 * u_scale_parent) + u_tl_parent;
#endif
}
"

